import React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/Home.css';

const Home = ({ onSearch }) => {
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearch = () => {
    onSearch(searchQuery);
  };

  return (
    <div className="Home">
      <div className="container">
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li>
              <Link to="/about">About</Link>
              <ul>
                <li><Link to="#">Our Story</Link></li>
                <li><Link to="#">Mission</Link></li>
                <li><Link to="#">Team</Link></li>
              </ul>
            </li>
            <li><Link to="/data">Service</Link></li>
          </ul>
        </nav>

        <div className="contenir">
          <input
            type="text"
            className="search"
            id="search-inp"
            placeholder="Search..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button className="search-btn" id="search-inp-btn" onClick={handleSearch}>&#x027A4;</button>
        </div>

        <div className="text">
          <span className="first-child">League <span className="mid">of</span></span>
          <span className="last-child">Legends</span>
        </div>
      </div>
    </div>
  );
};
export default Home;
